import React, {useState, useEffect}from "react";// {useState}
import GameSection from "./GameSection";


function App() {

    const [message, setMessage] = useState("");
    useEffect(() => {
      fetch("http://localhost:8000/message")
        .then((res) => res.json())
        .then((data) => setMessage(data.message));
    }, []);

    return (

        <div>
            <h1>This is 24</h1>
            <GameSection/>
            <h1>{message}</h1>
        </div>
    );
}

export default App;
